package com.fi.pj.milkit;

public class MilkitReviewinsert {
	private String id;
	private int fp_no;
	
	public MilkitReviewinsert() {
		// TODO Auto-generated constructor stub
	}

	public MilkitReviewinsert(String id, int fp_no) {
		super();
		this.id = id;
		this.fp_no = fp_no;
	}

	public String getId() {
		return id;
	}

	public void setId(String id) {
		this.id = id;
	}

	public int getFp_no() {
		return fp_no;
	}

	public void setFp_no(int fp_no) {
		this.fp_no = fp_no;
	}
	
	
}
